elem_dict.text:
.nrahq-nssf{
		display: flex;
		flex-flow: row wrap;
		justify-content: space-around;
		align-items: center;
		margin: 0 0 15px 0;
		padding: 0 15px;
	}
    .nrahq a, .nssf a, .we-hire-vets,
	.rating-logo-wrapper a,
	.verify-secure-logo-wrapper{
    	display: block;
		width: 125px;
		margin: 5px 0;
    }
	.rating-logo-wrapper{
		order: 2;
	}
	.nrahq-nssf .rating-logo-wrapper a{
		width: 200px;
	}
	.nrahq a img, .nssf a img, .we-hire-vets img,
	.rating-logo-wrapper a img,
	.verify-secure-logo-wrapper img{
		max-width: 100%;
		margin: auto;
	}
	#siteseal img{
		display: none;
	}
	#siteseal img:first-of-type{
		display: block;
	}
	/* For extra small devices */
	@media (max-width: 340px) {
		.nrahq a, .nssf a, .we-hire-vets,
		.rating-logo-wrapper a,
		.verify-secure-logo-wrapper{
			display: block;
			width: 90px;
			margin: 5px 0;
		}
		.nrahq-nssf .rating-logo-wrapper a{
			width: 170px;
		}
	}

    @media (min-width: 768px) {
    	.nrahq-nssf {
			padding: 0;
    		flex-flow: row;
			justify-content: space-between;
    		align-items: center;
			margin: 15px 0;
    	}
		.nrahq a, .nssf a, .we-hire-vets,
		.rating-logo-wrapper a,
		.verify-secure-logo-wrapper{
			width: 95px;
			margin: 0 5px;
		}
		.we-hire-vets{
			width: 90px;
		}
		.nrahq-nssf .rating-logo-wrapper a{
			width: 185px;
		}
		.rating-logo-wrapper{
			order: initial;
		}
    }

    @media (min-width: 768px) and (max-width: 991px) {
    	.nrahq-nssf {
    		justify-content: center;
    	}
    }

