Email Signup


    .footer-content-email-form p{
        margin-bottom: 0;
        line-height: inherit;
    }
    .pa-accent{
        text-transform: uppercase;
        font-size: 1rem;
        font-weight: 600;
    }
    .footer-content-email-form p.pa-white{
        font-size: 18px;
        text-transform: uppercase;
        font-weight: 700;
    }

    .email-signup{
        margin: 15px 0;
    }
    .email-signup-row{
        margin: 0;
    }
    .email-signup .email-title{
        display: none;
        text-align: center;
        padding: 0 15px;
    }
    .email-signup .icon-mail{
        font-size: 1.47rem;
        vertical-align: middle;
    }
    .email-signup-title-text{
        vertical-align: middle;
        margin-left: 3px;
    }
    .email-signup .input-base{
        border-radius: 50vh;
        font-size: 13px;
    }
    .email-signup input:focus{
        outline: none;
    }
    .email-signup .fsSubmitButton{
        border-radius: 50vh;
        border: none;
        background: #2D6ED1;
        color: #ffffff;
        font-weight: 400;
        display: inline-block;
        padding: 11px 10px;
        font-size: 13px;
    }
    .email-signup .fsSubmitButton:hover{
        background: #1c498e;
    }

    @media (min-width: 768px){
        .email-signup{
            margin: 0 0 10px 0;
        }
        .email-signup .email-title {
            display: block;
        }
        .email-signup-row .email-signup-input-wrapper,
        .email-signup-row .email-signup-button-wrapper{
            padding: 0;
        }
        .email-signup .input-base{
            border-radius: 50vh 0 0 50vh;
        }
        .email-signup .fsSubmitButton{
            border-radius: 0 50vh 50vh 0;
        }
    }

    @media screen and (max-width: 767px) {
        p.pa-accent{
            font-size: 18px;
        }
        .footer-content-email-form p.pa-white{
            font-size: 15px;
        }
    }    









